;----------------------recieve char in bl--------------
;-------------------------------------------------
RecieveChar      PROC    Far    

        push ax
        push dx


        ;Check that Data is Ready
        mov dx , 3FDH ; Line Status Register
        bdsada:       
        in al , dx
        and al , 1b
        JZ bdsada 

        mov dx , 03F8H
        in al , dx
        mov bl,al

        pop dx
        pop ax
        ret
RecieveChar     ENDP

