;----------------------recieve char in bl No Wait--------------
;-------------------------------------------------
RecieveCharW      PROC    Far    

        push ax
        push dx


        ;Check that Data is Ready
        mov dx , 3FDH ; Line Status Register
        in al , dx
        and al , 1b
        JZ sdsad 

        mov dx , 03F8H
        in al , dx
        mov bl,al

        sdsad:
        pop dx
        pop ax
        ret
RecieveCharW     ENDP

