;----------------------BIG CHAT  --------------
;-------------------------------------------------
BigChat PROC    FAR

; set the video mode
        mov ah, 0
        mov al, 03h
        int 10h
; set the configuration
        mov dx,3fbh             ; Line Control Register
        mov al,10000000b        ;Set Divisor Latch Access Bit
        out dx,al               ;Out it

        mov dx,3f8h
        mov al,0ch
        out dx,al

        mov dx,3f9h
        mov al,00h
        out dx,al

        mov dx,3fbh
        mov al,00011011b
        out dx,al

; delete the page first
        mov ah, 06h
        mov al, 0
        mov bh, 70h
        mov cx, 0100h
        mov dl, 79
        mov dh, 11
        int 10h
; deleting the second chat
        mov ah, 06h
        mov al, 0
        mov bh, 20h
        mov ch, 13
        mov cl, 0
        mov dl, 79
        mov dh, 24
        int 10h
; set the cursor at the beginning of the screen
        mov ah, 02h
        mov bh, 00h
        mov dl, 0
        mov dh, 0
        int 10h
        ; printing the sender name
        mov ah, 09h
        lea dx, NameP1
        int 21h
        ;get the cursor position
        mov senderCursorX, 00h
        mov senderCursorY, 01h
;set the cursor at the half of the screen
        mov ah, 02h
        mov bh, 00h
        mov dl, 0
        mov dh, 12
        int 10h
; print the receiver name
        mov ah, 09h
        lea dx, NameP2
        int 21h
;get the cursor position
        mov receiverCursorX, 00h
        mov receiverCursorY, 0dh
; change cursor again to the sender position
        mov dl, senderCursorX
        mov dh, senderCursorY
        mov ah, 02h
        mov bh, 00h
        int 10h
        jmp chat
; chatting loop
        receivex:	jmp receive
        Ch_l1x:		jmp Ch_l1
        chat:
        mov ah, 01h
        int 16h
        jz receivex
        mov ah, 00h
        int 16h
; check if exit
        cmp al, 27				;ESC
        jz Ch_l1x
        cmp al,13
        jne notEnter
        mov dl,10
        mov ah,2
        int 21h

notEnter:
	cmp al,8
	jnz notbackspace
	mov ah,2
	mov dl,8
	int 21h
        mov bl,dl
        call Sendchar
	mov dl,' '
	int 21h
        mov bl,dl
        call Sendchar
	mov dl,8
	int 21h
        mov bl,dl
        call Sendchar

notbackspace:
; read the character into chat_char
        mov chat_char, al
;set the cursor to the sender position
        mov ah, 02h
        mov bh, 00h
        mov dl, senderCursorX
        mov dh, senderCursorY
        int 10h
; print the character
        mov ah, 02h
        mov dl, al
        int 21h
; get the last position of the cursor and store it in the sender position register
        mov ah, 03h
        mov bh, 00h
        int 10h
        mov senderCursorX, dl
        mov senderCursorY, dh
; check if the char. reach to the end of the screen in order to scroll up
        cmp senderCursorY, 12
        jne Transmit
        cmp senderCursorX, 0
        jne Transmit
        mov ah, 06h
        mov al, 1h
        mov cx, 0100h
        mov dl, 79
        mov dh, 11
        mov bh, 70h
        int 10h
; set the cursor to the previous position
        dec senderCursorY
        mov ah, 02h
        mov dl, senderCursorX
        mov dh, senderCursorY
        int 10h
    

Transmit:
        mov dx , 3FDH               ; Line Status Register
        In al , dx                  ;Read Line Status
        test al , 00100000b
        JZ receive                  ;Not empty

; if empty put the key pressed in the register and send it
        mov dx , 3F8H               ; Transmit data register
        mov al, chat_char
        out dx , al
        jmp receive
l2:
jmp chat
Ch_l1:
jmp ENDING_CH
receive:
        mov dx , 3FDH               ; Line Status Register
        in al , dx
        test al , 1
        JZ l2                     ;Not Ready
        ; if the data is ready so receive it and print
        mov dx , 03F8H
        in al , dx
        mov chat_char , al
        ; set the cursor to receiver position
        mov ah, 02h
        mov bh, 00h
        mov dl, receiverCursorX
        mov dh, receiverCursorY
        int 10h
; print the received character
	cmp al,13
	jne notEnter2
	mov dl,10
	mov ah,2
	mov bh, 02h
	int 21h

notEnter2:
        and al,al
        jz ENDING_CH
        mov ah, 02h
        mov bh, 02h
        mov dl, chat_char
        int 21h
; get the last position of the cursor
        mov ah, 03h
        mov bh, 00h
        int 10h
        mov receiverCursorX, dl
        mov receiverCursorY, dh

; check if the char. reach to the end of the screen in order to scroll up
        cmp receiverCursorY, 24
        jne l2
        cmp receiverCursorX, 0
        jne l2
        mov ah, 06h
        mov al, 1h
        mov cl, 0
        mov ch, 13
        mov dl, 79
        mov dh, 24
        mov bh, 20h
        int 10h
; set the cursor to the previous position
        dec receiverCursorY
        mov ah, 02h
        mov dl, receiverCursorX
        mov dh, receiverCursorY
        int 10h
        jmp chat

ENDING_CH: 
        mov bl,0
        call Sendchar
; set the video mode
        mov ah, 0
        mov al, 13h
        int 10h

        RET        
BigChat ENDP
