;----------------------DRAW SQUARE--------------
;-------------------------------------------------
drawSqr              PROC    FAR                             

                        mov ah,0Ch
        ;-------------------------------------------------
                        push si
                        push di
                        xor si,si
        draw_sqr_outer:
                        cmp si,SquareWidth
                        jg draw_sqr_eee
                        XOR DI,DI
        draw_sqr_inner:  
                        cmp di,SquareWidth
                        jg draw_sqr_outerr
                   
                        add cx,si
                        add dx,di
                        int 10h

                        sub dx,di
                        sub dx,di
                        int 10h

                        sub cx,si
                        sub cx,si
                        int 10h
                        add dx,di
                        add dx,di
                        int 10h

                        add cx,si
                        sub dx,di
                        inc di
                        jmp draw_sqr_inner
        draw_sqr_outerr:   
                        inc si
                        jmp draw_sqr_outer

        draw_sqr_eee:     
                        pop di
                        pop si
                     
        ;-------------------------------------------------
;
;INT 10h / AH = 0Ch - change color for a single pixel.
;input:
;AL = pixel color
;CX = column.
;DX = row.                
                        RET
drawSqr              ENDP
;-------------------------------------------------
;----------------------DRAW RECT--------------
;-------------------------------------------------
drawRect              PROC    FAR      

                        mov ah,0Ch
        ;-------------------------------------------------
                        push si
                        push di
                        xor si,si
                        dec SquareWidth
                      
        draw_rec_outer:
                        cmp si,SquareWidth
                        jg draw_rec_eee
                        XOR DI,DI
        draw_rec_inner:  
                        cmp di,SquareWidth
                        jg draw_rec_outerr
                   
                        add cx,si
                        add dx,di
                        int 10h

                        sub dx,di
                        sub dx,di
                        int 10h

                        sub cx,si
                        sub cx,si
                        int 10h
                        add dx,di
                        add dx,di
                        int 10h

                        add cx,si
                        sub dx,di
                        inc di
                        jmp draw_rec_inner
        draw_rec_outerr:   
                        inc si
                        cmp si,SquareWidth
                        jnz draw_rec_outer

        draw_rec_eee:     
                        pop di
                        pop si
                     
                     inc SquareWidth
        ;-------------------------------------------------
;
;INT 10h / AH = 0Ch - change color for a single pixel.
;input:
;AL = pixel color
;CX = column.
;DX = row.                
                        RET
drawRect              ENDP
