;----------------------BIG RANDOM X Y IN CX DX--------------
;-------------------------------------------------
Big_random_x_y      proc FAR
        Big_rnd_again:
        call random_x_y
        sub cx,3d
        sub dx,3d

        mov ah,0dh
        sub cx,7
        int 10h
        and al,al
        jnz Big_rnd_again
        sub dx,7
        int 10h
        and al,al
        jnz Big_rnd_again
        add cx,7d
        int 10h
        and al,al
        jnz Big_rnd_again

        add dx,7

                ret
Big_random_x_y      ENDP
