        lea SI,S1X
        lea Di,S1Y
        add si,2
        add di,2
        mov Bp,word ptr Sz1
        and bp,0FH
        dec Bp
        mov imgW,7
        mov imgH,7
init_draws1:
                mov cx,[si]
                mov dx,[di]
                push di
                mov di,offset Img_S1_B
                call Draw_Image
                pop di
                add si,2
                add di,2
                dec Bp
                jnz init_draws1



;---------------------------------------
; snake 2

        ; common X factor of all points in snake2
