advancesnakes           PROC    FAR                              ;DirS1: [0 for left / 1 for up / 2 for right / 3 for down]
          
;       Getting NEW Sanke 1 HEAD
        cmp Num_Of_LOOPs_S2,0
        je snake1head
        dec Num_Of_LOOPs_S2
        jmp snake2Head
        ; original head in (si,di)
snake1head:
        mov si,S1X
        mov di,S1Y
        mov bx,word ptr DirS1
        mov bh,0
        cmp bx,4
        jz advance_left
        and bx,bx
        cmp bx,0
        jz advance_left
        cmp bx,1
        jz advance_up
        cmp bx,2
        jz advance_right

        advance_down:                                   ; move y down
                add di,SnakeWidth
                add di,SnakeWidth
                jmp advance_eee
        advance_left:                                   ; move x left
                sub si,SnakeWidth       
                sub si,SnakeWidth
                jmp advance_eee
        advance_up:                                     ; move y up
                sub di,SnakeWidth
                sub di,SnakeWidth
                jmp advance_eee
        advance_right:                                  ; move x right
                add si,SnakeWidth
                add si,SnakeWidth

        advance_eee:
                mov S1HX,si
                mov S1HY,Di
